	//create svg
	createSVG: function (options) {
	 
	    options = options || {};
	    options = {
			type: options.type || 'Marker',
			color: options.color || '#00FF00:Marker',
			forLegend: options.forLegend || false,
		};

		var colorParts = options.color.split(':');
		var markerColor = colorParts[0];
		var markerShape = MAMarkerBuilder.shapes[colorParts[1] || 'Marker'];
		var svgHTML;

		if (options.type == 'Scatter') {
			markerShape = MAMarkerBuilder.shapes['Scatter'];
		}
		
        if(options.color.indexOf('image:') === 0) {
            //grab the image url from imgLoaderDimensions
            var imageId = options.color.split('image:')[1];
            var imgURL = '';
            var imgHeight = '';
            var imgWidth = '';
            if(imgLoaderDimensions[imageId] && imgLoaderDimensions[imageId].imgURL) {
                imgURL = imgLoaderDimensions[imageId].imgURL;
            }
            else {
				if(imageId.substring(0, 3) === '015') {
					imgURL = '/servlet/servlet.FileDownload?file='+imageId;
				}
                else {
					imgURL = '/sfc/servlet.shepherd/version/download/'+imageId;
				}
            }
            if (options.forLegend) {
                return '<img style="max-height:20px;" src="'+imgURL+'"/>';
            }
            return '<img src="'+imgURL+'"/>';
        }
		svgHTML = MAMarkerBuilder[markerShape.selector]
			.replace(/__INDEX__/g, MAMarkerBuilder.index++)
			.replace(/__GRADIENT_ONE__/g, markerColor)
			.replace(/__GRADIENT_TWO__/g, MAMarkerBuilder.shadeColor(markerColor, 35))
			.replace(/__CIRCLE_STROKE__/g, MAMarkerBuilder.shadeColor(markerColor, 25))
			.replace(/__CIRCLE_FILL__/g, MAMarkerBuilder.isDark(markerColor) ? MAMarkerBuilder.unshadeColor(markerColor, 90) : MAMarkerBuilder.shadeColor(markerColor, 90))
		;

		if (options.forLegend) {
			svgHTML = svgHTML.replace(/__ICON_WIDTH__/g, markerShape.legendSize.x).replace(/__ICON_HEIGHT__/g, markerShape.legendSize.y);
		}
		else {
		    svgHTML = svgHTML.replace(/__ICON_WIDTH__/g, markerShape.size.x/2).replace(/__ICON_HEIGHT__/g, markerShape.size.y/2);
		}
		return svgHTML;
	},

	//color util
	shadeColor: function (color, percent) {   
		var num = parseInt(color.slice(1),16), amt = Math.round(2.55 * percent), R = (num >> 16) - amt, B = (num >> 8 & 0x00FF) - amt, G = (num & 0x0000FF) - amt;
		return "#" + (0x1000000 + (R<255?R<1?0:R:255)*0x10000 + (B<255?B<1?0:B:255)*0x100 + (G<255?G<1?0:G:255)).toString(16).slice(1);
	},
	unshadeColor: function (color, percent) {
		var num = parseInt(color.slice(1),16), amt = Math.round(2.55 * percent), R = (num >> 16) + amt, B = (num >> 8 & 0x00FF) + amt, G = (num & 0x0000FF) + amt;
		return "#" + (0x1000000 + (R<255?R<1?0:R:255)*0x10000 + (B<255?B<1?0:B:255)*0x100 + (G<255?G<1?0:G:255)).toString(16).slice(1);
	},
	isDark: function (color) {
		var num = parseInt(color.slice(1),16);
		return (num >> 16) + (num >> 8 & 0x00FF) + (num & 0x0000FF) < 225;
	},

	getRecordMarkerImageMarkup: function(record) {
		var image = null;

		if(record && typeof record == 'object') 
		{
			var marker = record.marker;

			if (marker instanceof RichMarker) {
            	if(marker.content) {
            		image = $(marker.content).attr('viewbox', '0 0 27 42').attr('height', '30').attr('width', '20');
            	}	
            }
            else if (marker instanceof StyledMarker) {
                // get the styled info
                var background = '#ABABAB';
                if(marker.styleIcon && marker.styleIcon.color) {background = marker.styleIcon.color;}

                image = '<span style="font-size: 20px;vertical-align: middle;margin-right: 4px;color:'+background+';" class="MAIcon ion-chatbox"></span>';
            }
            else if (record.type == 'dataLayer') {
            	var markerIconURL = MA.getProperty(marker, ['icon', 'url']);

            	if(markerIconURL) {
            		image = '<img src="' + markerIconURL + '" style="max-height: 20px; max-width: 20px;">';
            	} 
            }
            else {
            	var markerIconURL = MA.getProperty(marker, ['icon', 'url']);

            	if(markerIconURL) {
                	image = '<img src="' + markerIconURL + '" style="max-height: 30px; max-width: 30px;">';
            	}
            }
		}

		return image;
	},
	
